            GD2.BitmapHandle(GRADIENT_HANDLE);
            GD2.BitmapSize(GD2.Filter.Nearest, GD2.Wrap.Repeat, GD2.Wrap.Border, 480, 272);

            // Create a simple gradient for the background
            GD2.Clear();
            GD2.ColorMask(1, 1, 1, 0);
            GD2.Gradient(0, 40, 0x505060, 0, 272, 0xc0c080);

            // Draw the top logo
            GD2.Begin(GD2.Primitive.Bitmaps);
            GD2.Vertex2ii(x, 80, GAMEDUINO_HANDLE, 0);

            GD2.ColorMask(0, 0, 0, 1);
            GD2.BlendFunc(GD2.Blend.One, GD2.Blend.Zero);
            GD2.Vertex2ii(0, 180, GRADIENT_HANDLE, 0);

            // Invert the image
            GD2.Translate(0, 65536 * GAMEDUINO_HEIGHT / 2);
            GD2.Scale(65536, -65536);
            GD2.Translate(0, -65536 * GAMEDUINO_HEIGHT / 2);
            GD2.SetMatrix();

            // Mask with the gradient
            GD2.BlendFunc(GD2.Blend.Zero, GD2.Blend.SrcAlpha); 
            GD2.Vertex2ii(x, 190, GRADIENT_HANDLE, 0);

            // Draw the reflected logo
            GD2.ColorMask(1, 1, 1, 0);
            GD2.BlendFunc(GD2.Blend.DstAlpha, GD2.Blend.OneMinusDstAlpha);
            GD2.Vertex2ii(x, 190, GAMEDUINO_HANDLE, 0);

            GD2.Swap();
